  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Devils Lake Wetland
  Management District outlines District accomplishments for the calendar year of 1972.
  The report begins by giving a brief description of the District, and summarizing
  the acquisition program and wetland easement program. Weather conditions, habitat
  conditions, water conditions, and food and cover during this period are summarized.
  Wildlife- including migratory birds, upland game birds, big game animals, fur animals,
  predators, rodents, and other mammals, reptiles, and disease- is also covered. The
  District development and maintenance section discusses physical developments, plantings,
  and vegetation control. Resource management is outlined; topics include grazing,
  haying, and fur harvesting. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  recreational uses, District visitors, District participation, hunting, violations,
  safety, and revenue sharing. N-R forms and photographs are attached.\",\n\t\"license_title\":
